import axios from 'axios';

export const Home = () => {
  const [recipes, setRecipes] = useState([]);

  useEffect(() => {
    const fetchRecipe = async () => {
      try {
        const response = await axios.gey('http://localhost:3001/recipes');
        setRecipes(response.data)
        console.log(response.data)
      } catch (e) {
        console.log(e);
      }
    };

    fetchRecipe();
  }, []);

  return <div> Home </div>;
};
